c_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"939514","type":"CustomJS"},{"attributes":{},"id":"939444","type":"ResetTool"},{"attributes":{"coordinates":null,"data_source":{"id":"939184"},"glyph":{"id":"939185"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"939187"},"nonselection_glyph":{"id":"939186"},"view":{"id":"939189"}},"id":"939188","type":"GlyphRenderer"},{"attributes":{},"id":"939201","type":"UnionRenderers"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"939130"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"939321","type":"Scatter"},{"attributes":{"source":{"id":"939128"}},"id":"939319","type":"CDSView"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"939373"},"group":null,"major_label_policy":{"id":"939578"},"minor_tick_line_color":null,"ticker":{"id":"939345"}},"id":"939344","type":"LinearAxis"},{"attributes":{"data":{"Close":{"__ndarray__":"zczMzMxMYkBI4XoUrtdhQMP1KFyP2mFAXI/C9Sg0YkApXI/C9QhiQNejcD0KT2JApHA9CtdDYkAAAAAAAFhiQGZmZmZmlmJApHA9CterYkBcj8L1KIRiQArXo3A90mJApHA9CteTYkDXo3A9CmdiQFK4HoXrYWJAmpmZmZlZYkD2KFyPwl1iQPYoXI/CFWJAuB6F61EQYkCPwvUoXN9hQOxRuB6F62FAFK5H4Xr8YUCF61G4HgViQI/C9ShcB2JArkfhehQ2YkCamZmZmWliQOxRuB6Fa2JAmpmZmZlpYkAzMzMzM2tiQJqZmZmZcWJApHA9CtdjYkB7FK5H4YpiQEjhehSuz2JApHA9CtfbYkAK16NwPepiQMP1KFyP4mJAhetRuB7VYkBmZmZmZoZiQK5H4XoUzmJAhetRuB59YkB7FK5H4cJiQBSuR+F6xGJApHA9Cte7YkAAAAAAAOBiQHsUrkfhAmNA7FG4HoX7YkCkcD0K1/tiQLgehetRCGNAw/UoXI/6YkBmZmZmZuZiQI/C9Shcx2JAZmZmZma+YkApXI/C9WhiQOF6FK5HUWJA16NwPQr/YUAAAAAAAABiQOF6FK5HAWJAuB6F61EAYkAUrkfheuRhQFyPwvUo5GFAmpmZmZkBYkBSuB6F6xliQK5H4XoUHmJAPQrXo3AdYkDXo3A9CjdiQD0K1
